import React from 'react';
// Import the images
import AnnaImage from './assets/homehealth.jpg'; // Update the path as necessary
import SusieImage from './assets/resources/susie.jpg'; // Update the path as necessary

const WhoWeAre = () => {
  return (
    <div className="max-w-4xl mx-auto p-4">
      <h1 className="text-2xl font-bold text-center mb-8">Who We Are</h1>
      <div className="flex flex-wrap justify-around items-center">
        {/* Anna's Container */}
        <div className="m-4 p-4 border-2 border-yellow-500 rounded-lg flex flex-col items-center max-w-sm w-full">
          <img src={AnnaImage} alt="Anna Laboy" className="w-48 h-48 object-cover rounded-full mb-4"/>
          <h2 className="text-xl font-semibold">Anna Laboy</h2>
          <p className="text-sm">Co-Founder & Senior Advocate</p>
          <p className="text-justify mt-4">
            Anna Laboy is a Murfreesboro native with a passion for seniors & her community! Her GRAMPS team has over 4 decades of service in the senior sector & consists of specialists in various areas pertaining to our golden years.
            Our goal is to walk beside and relieve the family of any stressors that may arise with changing needs and empower them with knowledge.
            We strive to provide assistance to seniors & their families by taking them step by step through the entire journey of the aging process.
          </p>
        </div>

        {/* Susie's Container */}
        <div className="m-4 p-4 border-2 border-yellow-500 rounded-lg flex flex-col items-center max-w-sm w-full">
          <img src={SusieImage} alt="Susie Eskew" className="w-48 h-48 object-cover rounded-full mb-4"/>
          <h2 className="text-xl font-semibold">Susie Eskew</h2>
          <p className="text-sm">Co-Founder & Senior Consultant</p>
          <p className="text-justify mt-4">
            Susie Eskew is a Tennessee native, having grown up and graduated college in Martin, Tn, the daughter of college mathematics educators.
            She has loved and served the 55+ population her entire life! She is passionate about advocating for, educating, empowering, and ensuring good health and happiness of all ages, but specifically seniors, as so many are alone.
          </p>
        </div>
      </div>
    </div>
  );
};

export default WhoWeAre;
